const Data = (props) => {

  useEffect( () => {
    setInterval(() => {
      if (!props.isContentLoaded) {

          props.getCategories();
          props.getSubcategories();
      }
    }, 500);
  }, [props.isContentLoaded]);

  return (
      <div/>
  );
};

export default Data;
